from itertools import cycle
import sys
import os
import json


class Encryptor:
    def __init__(self):
        with open(os.path.join(os.path.dirname(__file__), 'key.txt'), 'rb') as f:
            self._key = cycle(f.read(128))

    def encrypt(self, plain):
        return ''.join(chr(ord(p) ^ k) for p, k in zip(plain, self._key))

    def decrypt(self, cipher):
        return self.encrypt(cipher)


